UPDATE `quest_template` SET `QuestDescription`='King Mechagon unit in possession of Norgannon disk. Data is corrupted, possession of such data is dangerous.\n\nPlease aid in the recovery of Corrupted Disk Fragments that have been discarded via Mechagon waste systems. \n\nDeliver recovered Corrupted Disc Fragment to Data Analyzer R33-DR for purging.', `VerifiedBuild`=32978 WHERE `ID`=56410; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You Rustbolt resisters inspire me. Tinkering, building, exploring.\n\nLetting your imagination run wild and then chasing after it, wherever it leads, with reckless abandon!\n\n<Walton releases a deep sigh.>\n\nI miss those days. I hope, someday, my conscience will allow me to stay on the surface with you all permanently...\n\nBefore I return to Mechagon, we must build something incredible.\n\nWaren and I have identified a large number of extra construction project sites for today. \n\nBuild with boldness!', `VerifiedBuild`=32978 WHERE `ID`=56405; -- -Unknown-
