UPDATE `quest_template` SET `QuestDescription`='You exist here due to a time anomaly, but you must return to your own time and help us there.\n\nThe Visual Holo Sphere from the Vaultbot nearby contains the data necessary to defeat King Mechagon before he can use the Mechoriginator.\n\nDeliver the Visual Holo Sphere to me in your reality. With luck I will be able to rewind history and prevent this existence from ever happening.', `VerifiedBuild`=32978 WHERE `ID`=56365; -- -Unknown-
