UPDATE `quest_template` SET `QuestDescription`='Neptulian clams are an important part of the ankoan diet.\n\nMany forget how important proper nutrition is during a time of war. A warrior can be armed with the finest weapons and training, but if she is not healthy and well-nourished she will be ineffective in battle.\n\nNow that Mezzamere is home to your Alliance, we must work hard to gather enough food to feed our soldiers.\n\nGather as many Neptulian clams as you can find and I will see that they make it back to camp safely.', `VerifiedBuild`=32978 WHERE `ID`=56153; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We must strike now before the Horde have a chance to gain a secure foothold. Attack their champions and knock them on their heels.', `VerifiedBuild`=32978 WHERE `ID`=56128; -- -Unknown-
UPDATE `quest_template` SET `RewardXPDifficulty`=7, `RewardMoney`=702000, `RewardMoneyDifficulty`=7, `RewardBonusMoney`=329200, `RewardItem1`=170069, `RewardAmount1`=1, `RewardFactionID1`=2395, `RewardFactionOverride1`=50000, `AllowableRaces`=6130900294268439629, `LogTitle`='Leaving the Hive', `LogDescription`='Speak to Barry in the Honeyback Hatchery.', `QuestDescription`='<The enormous bee twitches its antennae toward you. It swings its abdomen toward the cave exit.>\n\nBarry might know what\'s going on.', `VerifiedBuild`=32978 WHERE `ID`=56108; -- -Unknown-
UPDATE `quest_template` SET `FlagsEx`=8192, `QuestDescription`='Those rampaging bots ain\'t lettin\' up!\n\nWe\'re payin\' good money for the best and brightest goblins on the planet, and I ain\'t gonna let some malfunctionin\' machinery take \'em outta the shift schedule.\n\nThis is textbook unsafe working conditions, and the Greasemonkey Union reps are givin\' me an earful for it. Protect the workers!', `VerifiedBuild`=32978 WHERE `ID`=56083; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You\'ve been holding out on me!\n\nHere I was, thinking that we\'re friends now and yet you neglected to tell me about your magnificient wrench!\n\n<Christy inspects it closely.>\n\nWell, not too magnificient... I recognize the Ub3r-Spanner from its blueprints, but whoever built this lacks a certain level of craftsmanship.\n\nI will upgrade it for you. Bring me the Overcharged Mecha-core from a mechanocrawler.\n\nNo excuses. I will fix your mistakes.', `VerifiedBuild`=32978 WHERE `ID`=55979; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Some of our Roughriders are missing, I tried to find them, but got pinned down here by the bugs! \n\nI could really use your help, $n. See if you can save my missing troopers.', `VerifiedBuild`=32978 WHERE `ID`=55885; -- -Unknown-
UPDATE `quest_template` SET `LogDescription`='Kill $1oa rare creature in Nazjatar.', `VerifiedBuild`=32978 WHERE `ID`=55837; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The makrura have been a thorn in our side for too long. They are aggressive towards almost all species in Nazjatar and are very dangerous in groups. Less of them in our waters would certainly benefit our cause.\n\nOnce you are done, report to the quartermaster to claim your reward.', `VerifiedBuild`=32978 WHERE `ID`=55831; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The makrura have been a thorn in our side for too long. They are aggressive towards almost all species in Nazjatar and are very dangerous in groups. Less of them in our waters would certainly benefit our cause.\n\nOnce you are done, report to the quartermaster to claim your reward.', `VerifiedBuild`=32978 WHERE `ID`=55822; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In my travels of the many possible futures, I discovered another place much like Rustbolt, but different.\n\nIn this other time and place, very little is alive, everything is machines.\n \nYou must travel to this other place. You will scan the memory banks of the Clockwork Giants you find there. Then we will use that data to ensure that our Rustbolt never becomes the other place.', `VerifiedBuild`=32978 WHERE `ID`=55816; -- -Unknown-
UPDATE `quest_template` SET `LogDescription`='Deliver $1oa Particularly Dense Rock to Steelsage Gao.', `VerifiedBuild`=32978 WHERE `ID`=55815; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We are dangerously low on our medicine stores. If you find any Spiral Leaf, please leave your stores with the quartermaster.\n\nI should warn you, Spiral Leaf is immensely poisonous. Make sure to handle it with care. Some symptoms of spiral leaf poisoning include bouts of rage, immense bursts of strength, and murderous impulses. If you are exposed, find some naga and use your murderous energy for good.', `VerifiedBuild`=32978 WHERE `ID`=55791; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Sylvanas Windrunner was once my ranger-general. Now she is my warchief. Through peacetime and war, I followed her orders.\n\nUntil now.\n\nBaine is a noble soul. His execution would drive a blade into the very heart of the Horde.\n\nWe must save him, $n. It is the only way to preserve who we are. What we stand for.  \n\nI have reached out to allies who will help you. But in siding with them, you will put your own life in peril.\n\nIf you feel as I do, then meet them in the Cleft of Shadows. Good luck.', `VerifiedBuild`=32978 WHERE `ID`=55781; -- -Unknown-
UPDATE `quest_template` SET `TreasurePickerID`=1421, `RewardCurrencyID1`=0, `RewardCurrencyQty1`=0, `VerifiedBuild`=32978 WHERE `ID`=55737; -- -Unknown-
