UPDATE `quest_template` SET `QuestDescription`='The legs and shocks on this mount are shot! We\'ll need some new ones if we\'re going to get this mount crawling.\n \nA few weeks ago, Bondo and his gang rode into the Scrapbone Den hoping to scare the Troggs off. The Troggs tore their crawlers apart! The parts for those crawlers are still laying all around Scrapbone Den.\n\nSee if you can get us some of those parts from the Troggs.', `VerifiedBuild`=32978 WHERE `ID`=55697; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It\'s not every day that you encounter the remnants of a lost civilization beneath the ocean!\n\nI never would have imagined that I\'d have the opportunity to explore the lost city of Nazjatar... and on solid ground at that!\n\nThere are many secrets here to uncover. If you come across any ancient highborne artifacts, please bring them to me. These relics could provide us with valuable clues regarding the mysteries of the Great Sundering.\n\nI feel as though we are barely scratching the surface so far...', `VerifiedBuild`=32978 WHERE `ID`=55659; -- -Unknown-
UPDATE `quest_template` SET `Flags`=576717312, `VerifiedBuild`=32978 WHERE `ID`=55657; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mount\'s all polished up and looking great. We are almost done!\n\nI gave the Powercore Schematics to PASCAL-K1N6. He\'s ready to build us a new 500S-Cybergenic Powercore, once you get him the parts.\n\nWe install that powercore and you can drive this bot away today!', `VerifiedBuild`=32978 WHERE `ID`=55622; -- -Unknown-
