UPDATE `quest_template` SET `QuestDescription`='Darkshore is home to several elemental breaches which hold massive amounts of power. \n\nThe remnants of the Twilight\'s Hammer know this. While we were preoccupied with the Kaldorei, their elementalists have moved to exploit these locations of power, calling forth massive elementals to do their bidding.\n\nTheir actions must not go unchecked.', `VerifiedBuild`=32978 WHERE `ID`=54844; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Are you curious about how the Kul Tirans joined the Alliance? \n\nIt was assumed that Kul Tiras would rejoin the Alliance after everything that was done to stabilize their nation.\n\nLady Jaina Proudmoore wanted to cement the allegiance by building King Anduin a ship worthy of the Kul Tiran navy.\n\nShe wished for help in finding the best shipwright in Kul Tiras, Dorian Atwater. It wouldn\'t be easy, as Dorian was retired.\n\nIt all began with a trip to see Cyrus in Boralus Harbor...', `VerifiedBuild`=32978 WHERE `ID`=54706; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Kerchunk said you guys was working on getting that mechaspider running again. Well I\'m not gonna let you have all the fun!\n\nThat rusty old thing\'s gonna need a lot of grease to get moving again. So I jury-rigged a special Grease Trap to help you gather grease from the slimes nearby.', `VerifiedBuild`=32978 WHERE `ID`=54083; -- -Unknown-
