UPDATE `quest_template` SET `QuestDescription`='You wish to hear how the Zandalari joined the Horde? My people have had a... difficult history with the Zandalari.\n\nHowever, I believe we dealt with the Zandalari of the past. The now Queen Talanji is much different from her father.\n\nI\'m rambling, my apologies. Our tale begins after the Alliance sacked the city of Zuldazar and killed King Rastakhan.\n\nThe Horde had been invited by the then Princess Talanji to witness her coronation in Zuldazar...', `VerifiedBuild`=32978 WHERE `ID`=53831; -- -Unknown-
