UPDATE `quest_template` SET `QuestDescription`='As ambassador, it is my duty to bolster the Horde\'s ranks and strengthen our numbers in the face of danger.\n\nYour adventures have led you to many different people who can aid the Horde if we can convince them to join our cause.\n\nI\'ve kept a record of the most promising potential allies. The choice of which to approach first is yours.', `VerifiedBuild`=32978 WHERE `ID`=50242; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I was chosen to act as an ambassador to our new allies due to my experience with the pandaren joining the Alliance.\n\nI\'ve made some notes about some potential allies that may be willing to join the Alliance.\n\nLearn more about them, then speak with me.', `VerifiedBuild`=32978 WHERE `ID`=50239; -- -Unknown-
