UPDATE `quest_template` SET `QuestDescription`='Would you like to hear how the nightborne came to join the Horde?\n\nWe earned their trust when we aided them in liberating Suramar from the tyranny of Grand Magistrix Elisande and the Burning Legion.\n\nLor\'themar Theron later asked them to join him in Quel\'Thalas. Lady Liadrin made the journey to extend the invitation to First Arcanist Thalyssra...', `VerifiedBuild`=32978 WHERE `ID`=49973; -- -Unknown-
UPDATE `quest_template` SET `LogDescription`='Meet Ji Firepaw at the Orgrimmar Embassy.', `QuestDescription`='Greetings, champion! I have been appointed as the Horde\'s diplomatic ambassador to our allies far and wide. \n\nIt is my duty to seek out those of like mind and spirit, and speak to them about joining the Horde.\n\nAs a renowned hero of the Horde yourself, your aid would be most appreciated! Come see me at the embassy in Orgrimmar when you are able.', `VerifiedBuild`=32978 WHERE `ID`=49930; -- -Unknown-
UPDATE `quest_template` SET `LogDescription`='Meet Aysa Cloudsinger at the Stormwind Embassy.', `QuestDescription`='The Alliance has been beset by dangers growing throughout all of Azeroth.\n\nThe only way we will keep our friends safe is if we seek out new allies.\n\nI have been tasked as an ambassador to help seek these allies. Come to our embassy in Stormwind, I could use your help.', `VerifiedBuild`=32978 WHERE `ID`=49929; -- -Unknown-
UPDATE `quest_template` SET `Flags`=40894464, `QuestDescription`='Are you familiar with how the Void elves joined the Alliance? \n\nIt began with Alleria Windrunner finding out about a blood elf named Umbric. \n\nHe and his followers were banished from Silvermoon City for researching void magic.\n\nAlleria believed she could convince Umbric and his followers to join the Alliance and prevent the void from corrupting them.\n\nIt all began when she opened up a portal to go into the Ghostlands...', `VerifiedBuild`=32978 WHERE `ID`=49787; -- -Unknown-
